import React from "react";
import Scroll from "react-scroll";
import styled from "styled-components";
import logo from "./logo.png";

var Element = Scroll.Element;

const Post = styled.div`
  display: flex;
  position:fixed
  flex-direction: column;
  overflow-y: scroll;
  scroll-behavior: smooth;
  overflow-x: hidden;
  overflow-y: scroll;
`;

const Item = styled.div`
  margin-left: 1vw;
  height: 480px;
  width: 320px;
  border: solid #d72323 5px;
  border-radius: 1.2rem;
  margin-bottom: 1rem;
`;

const CardDescription = styled.div`
  display: flex;
  justify-content: flex-start;
  flex-direction: column;
  width: 250px;
  margin-bottom: -20px;
  margin-left: 30px;
  color: #fff;
`;

const CardImage = styled.img`
  width: 240px;
  height: 170px;
  margin-left: 35px;
  margin-top: 35px;
  border: solid #fff 0.2px;
  border-radius: 1rem;
`;

function Verticalscroll() {
  return (
    <Post>
      <Item>
        <CardImage src={logo} alt="" />
        <CardDescription>
          <h1
            style={{
              fontSize: "20px",
              marginBottom: "-20px",
              padding: "0",
              fontWeight: "bold",
            }}
          >
            Crypto Market Tracker
          </h1>
          <br /> Libraries Used:
          <br />- Axios [For API]
          <br />- Framer Motion[Animation]
          <br />- Styled-Components[CSS]
        </CardDescription>
      </Item>
      <Item>
        <CardImage src={logo} alt="" />
        <CardDescription>
          <h1
            style={{
              fontSize: "20px",
              marginBottom: "-20px",
              padding: "0",
              fontWeight: "bold",
            }}
          >
            Crypto Market Tracker
          </h1>
          <br /> Libraries Used:
          <br />- Axios [For API]
          <br />- Framer Motion[Animation]
          <br />- Styled-Components[CSS]
        </CardDescription>
      </Item>
      <Item>
        <CardImage src={logo} alt="" />
        <CardDescription>
          <h1
            style={{
              fontSize: "20px",
              marginBottom: "-20px",
              padding: "0",
              fontWeight: "bold",
            }}
          >
            Crypto Market Tracker
          </h1>
          <br /> Libraries Used:
          <br />- Axios [For API]
          <br />- Framer Motion[Animation]
          <br />- Styled-Components[CSS]
        </CardDescription>
      </Item>
    </Post>
  );
}

export default Verticalscroll;
